Cast: Alektra Blue, Jennifer White, Kayla Paige, Victoria Rae Black, Tony de Sergio, Seth Gamble, Joey Brass, Brendon Miller

When Marsha's (Alektra Blue) fiance Larry (Seth Gamble) gets cold feet three months before the wedding, her world is turned upside down. Now it's up to her best friends, to help her get out of her funk and back on the market. The only problem is that her aggressive cougar friend Bailey, is unable to give her meaningful advice and Taryn the commitment-phobe, has just fallen in love with her long time crush Rob. Can a one night stand help Marsha find love again, or will she find out that breaking up is good to do!
